import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'date',
})
export class DatePipe implements PipeTransform {
  transform(value: Date, ...args: unknown[]): unknown {
    console.log(value);
    return value.setDate(value.getDate() + 3);
  }
}
